import axios from "axios";
import { Component } from "react";
import './App.css';
import useAlgo from "./useAlgo"



export default function App(){
  const url1 = './Food3.json'
  const url2 = './popularpoll.json'
  const url3 = './Heuristic.json'

  return (
    <div>
    <button  id='btn1' onClick={useAlgo(url1)}> Random </button>
    <button  id='btn2' onClick={useAlgo(url2)}> Popular </button>
    <button  id='btn3'onClick={useAlgo(url3)}> Fresh </button>

    </div>
  );
}
